// import { useState } from 'react';





function NavBar() {
  // Activating Lateral Menu

  const showMenu = (toggleId, navId) => {
    const toggle = document.getElementById(toggleId);
    const nav = document.getElementById(navId);

    if (toggle && nav) {
      toggle.addEventListener('click', () => {
        nav.classList.toggle('show');
        toggle.classList.toggle('bx-x');
      })
    }
  }

  showMenu('header-toggle', 'nav-menu');

  // Changing Active Link

  const navLink = document.querySelectorAll('.nav-link');
  function linkAction() {
    navLink.forEach(n => n.classList.remove('active'));
    this.classList.add('active');
  }

  navLink.forEach(n => n.addEventListener('click', linkAction));
  return (
    <header className="header">
      <a href="#" className="header-logo">Clay</a>

      <div className="header-toggle">
        <i className="bx bx-menu" id="header-toggle"></i>
      </div>

      <nav className="nav" id="nav-menu">
        <div className="nav-content bd-grid">
          <a href="#" className="nav-perfil">
            <div className="nav-img">
              <img src="https://i.postimg.cc/Z5VcmyV0/perfil.jpg" alt="" />
            </div>

            <div>
              <span className="nav-name">Clay</span>
              <span className="nav-name">Mitchell</span>
            </div>
          </a>

          <div className="nav-menu">
            <ul className="nav-list">
              <li className="nav-item"><a href="#" className="nav-link active">Home</a></li>
              <li className="nav-item dropdown">
                <a href="#" className="nav-link dropdown-link">About <i className="bx bx-chevron-down dropdown-icon"></i></a>

                <ul className="dropdown-menu">
                  <li className="dropdown-item"><a href="#" className="nav-link">About me</a></li>
                  <li className="dropdown-item"><a href="#" className="nav-link">Location</a></li>
                  <li className="dropdown-item"><a href="#" className="nav-link">Studies</a></li>
                </ul>
              </li>
              <li className="nav-item"><a href="#" className="nav-link ">Skills</a></li>
              <li className="nav-item dropdown">
                <a href="#" className="nav-link dropdown-link">Works <i className="bx bx-chevron-down dropdown-icon"></i></a>
                <ul className="dropdown-menu">
                  <li className="dropdown-item"><a href="#" className="nav-link">Recent Jobs</a></li>
                  <li className="dropdown-item"><a href="#" className="nav-link">Best Jobs</a></li>
                  <li className="dropdown-item"><a href="#" className="nav-link">Work Awards</a></li>
                </ul>
              </li>
              <li className="nav-item"><a href="#" className="nav-link ">Contact</a></li>
            </ul>
          </div>
        </div>
      </nav>
    </header>

  );

}
export default NavBar;
